import React, { Component } from 'react';

export class UserGreeting extends Component {

    constructor(props) {
        super(props)

        this.state = {
            isLoggedin: true
        }
    }



    render() {

        if (this.state.isLoggedin) {

          return  <div>console.log('Welcome Guest')</div> 

        } else {

         return    <div>console.log('Please login')</div> 

        }

        return <div></div>;
    }
}

export default UserGreeting;
